import { useState } from "react";
import { FaHeart, FaRegHeart } from "react-icons/fa";

const Favorite = () => {
  const [fav, setFav] = useState(false);

  const handleClick = () => setFav(!fav);
  // click heart to fav a photo

  return (
    <div
      onClick={handleClick}
      className="text-xl drop-shadow p-1 hover:drop-shadow-xl transition-shadow"
    >
      <button>
        {fav ? (
          <FaHeart className="text-rose-600 drop-shadow" />
        ) : (
          <FaRegHeart className="text-white drop-shadow" />
        )}
      </button>
    </div>
  );
};

export default Favorite;
